import React from 'react'

const Section = styled.section`
position: relative;
min-height: 40vh;
width: 80vw;
display: flex;
flex-direction: column;
margin: 0 auto;
justify-content: space-evenly;
`

const CreateUser = () => {
  return (
    <Section>
      <div>CreateUser</div>
    </Section>
  )
}

export default CreateUser
